    [],nt"num_tags": 20,nt"name": "quivira-national-wildlife-refuge-vegetation-mapping-project-2010-2011",nt"isopen":
    false,nt"url": null,nt"notes": "Quivira National Wildlife Refuge was established
    in 1955, and a detailed vegetation map was not available for management purposes.
    With the present development of a biological program and Comprehensive Conservation
    Plan (CCP), a baseline vegetation map of the refuge was identified as a necessity.
    Development of the vegetation map and associated report was a multi-step process.
    Aerial photography (NAIP, 2008) was used with eCognition to create polygons of different
    plant communities based on the likeness of surrounding pixels in the area. Prior
    to ground-truthing, the following activities were accomplished: training on vegetation
    mapping using GIS (previous experience and National Conservation Training Center
    course), creation of an vegetation association and alliance dichotomous key, development
    of a refuge plant key and identification skills, and preparation of maps for ground
    truthing. Once out in the field dominant plants were identified for appropriate
    vegetation alliance and association classification, plant specimens were collected
    for the refuge herbarium as necessary and additional observations and photos were
    gathered for the report. Over the course of the project, classification data was
    entered into a GIS and polygons were appropriately modified to create the final
    map. At Quivira, results found a total of 42 alliances and 43 associations.The most
    dominant plants throughout the refuge in 2008 based on canopy cover were saltgrass,
    plum, little bluestem and cottonwood. The number of alliances and associations found
    on the refuge show high species diversity.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
